import React, { useEffect, useState } from "react";
import {
  ScatterChart,
  Scatter,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const PersonalResults = ({ user }) => {
  const [summaryAttempts, setSummaryAttempts] = useState([]);
  const [fullPassageAttempts, setFullPassageAttempts] = useState([]);
  const [globalAverages, setGlobalAverages] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    async function fetchData() {
      if (!user || !user.email) return;

      setLoading(true);
      setError(null);

      try {
        const res = await fetch(
  `https://read-racer.azurewebsites.net/api/getUserResults?userId=${encodeURIComponent(
    user.email
  )}`
);
if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);

        const data = await res.json();
        console.log("Raw data from backend:", data);

        const results = Array.isArray(data) ? data : data.results || [];
        const globalAvg = data.globalAverages || null;

        const summary = results.filter(
          (r) =>
            r.useSummary === true ||
            r.useSummary === "True" ||
            r.useSummary === "true"
        );
        const full = results.filter(
          (r) =>
            !(
              r.useSummary === true ||
              r.useSummary === "True" ||
              r.useSummary === "true"
            )
        );

        setSummaryAttempts(summary);
        setFullPassageAttempts(full);
        setGlobalAverages(globalAvg);

        console.log("Summary attempts:", summary);
        console.log("Full passage attempts:", full);
        console.log("Global averages:", globalAvg);
      } catch (err) {
        console.error("Failed to load user results:", err);
        setError(err.message || "Failed to load user results");
      } finally {
        setLoading(false);
      }
    }

    fetchData();
  }, [user]);

  const renderChart = (data, label, globalDot) => {
    if (!data || data.length === 0) return <p>No attempts yet.</p>;

    return (
      <div className="mb-8">
        <h3 className="text-xl font-semibold mb-2 text-gray-700">{label}</h3>
        <ResponsiveContainer width="100%" height={300}>
          <ScatterChart margin={{ top: 10, right: 20, bottom: 20, left: 0 }}>
            <CartesianGrid />
            <XAxis
              type="number"
              dataKey="wpm"
              name="Reading Speed"
              unit=" WPM"
              domain={["auto", "auto"]}
            />
            <YAxis
              type="number"
              dataKey="accuracy"
              name="Accuracy"
              unit="%"
              domain={[0, 100]}
            />
            <Tooltip cursor={{ strokeDasharray: "3 3" }} />
            <Legend />
            <Scatter name="Your Attempts" data={data} fill="#3b82f6" />
            {globalDot && (
              <Scatter
                name="Global Avg"
                data={[globalDot]}
                fill="#ef4444"
                shape="star"
              />
            )}
          </ScatterChart>
        </ResponsiveContainer>
      </div>
    );
  };

  if (!user) return <p>Please log in to see your personal results.</p>;
  if (loading) return <p>Loading your results...</p>;
  if (error) return <p className="text-red-600 font-semibold">Error: {error}</p>;

  return (
    <div className="p-6 max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">
        Your Personal Results
      </h2>

      {renderChart(
        summaryAttempts.map((r) => ({
          wpm: r.realWPM ?? r.effectiveWPM ?? 0,
          accuracy:
            r.total > 0 && r.score !== undefined
              ? Math.round((r.score / r.total) * 100)
              : 0,
        })),
        "AI Summary Attempts",
        globalAverages?.summary && {
          wpm: globalAverages.summary.avgWPM,
          accuracy:
            typeof globalAverages.summary.avgAccuracy === "number"
              ? globalAverages.summary.avgAccuracy * 100
              : 0,
        }
      )}

      {renderChart(
        fullPassageAttempts.map((r) => ({
          wpm: r.effectiveWPM ?? 0,
          accuracy:
            r.total > 0 && r.score !== undefined
              ? Math.round((r.score / r.total) * 100)
              : 0,
        })),
        "Full Passage Attempts",
        globalAverages?.full && {
          wpm: globalAverages.full.avgWPM,
          accuracy:
            typeof globalAverages.full.avgAccuracy === "number"
              ? globalAverages.full.avgAccuracy * 100
              : 0,
        }
      )}
    </div>
  );
};

export default PersonalResults;
